INSERT INTO `productdescription` VALUES (3,'Chromoly steel.','301EED3A-1A82-4855-99CB-2AFE8290D641','2013-04-30 00:00:00.000000'),(4,'Aluminum alloy cups; large diameter spindle.','DFEBA528-DA11-4650-9D86-CAFDA7294EB0','2013-04-30 00:00:00.000000'),(5,'Aluminum alloy cups and a hollow axle.','F7178DA7-1A7E-4997-8470-06737181305E','2013-04-30 00:00:00.000000'),(8,'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.','8E6746E5-AD97-46E2-BD24-FCEA075C3B52','2013-04-30 00:00:00.000000'),(64,'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to go off-road.','7B1C4E90-85E2-4792-B47B-E0C424E2EC94','2013-04-30 00:00:00.000000'),(88,'For true trail addicts.  An extremely durable bike that will go anywhere and keep you in control on challenging terrain - without breaking your budget.','4C1AD253-357E-4A98-B02E-02180AA406F6','2013-04-30 00:00:00.000000'),(128,'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.','130709E6-8512-49B9-9F62-1F5C99152056','2014-02-08 10:32:17.973000'),(168,'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.','DB979DA6-4CC8-4171-9ECF-65003FF8178A','2013-04-30 00:00:00.000000'),(170,'Suitable for any type of off-road trip. Fits any budget.','EA772412-6369-4416-9CC9-C1A5D1FF9C52','2013-04-30 00:00:00.000000'),(209,'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.','F5FF5FFD-CB7C-4AD6-BBC9-4D250BB6E98D','2013-04-30 00:00:00.000000'),(249,'Value-priced bike with many features of our top-of-the-line models. Has the same light, stiff frame, and the quick acceleration we\'re famous for.','4291F144-7693-4460-8B0B-1373E0433021','2013-04-30 00:00:00.000000'),(320,'Same technology as all